const AdmindashBoard = () => {
    return ( 
    <div className="adminDashBoard">
       <div className="container">
        <div className="image">
            <img src="/images/img.jpg" alt="" />
        </div>
        <div className="info">
            <h1>Welcome to Admin Dashboard</h1>
            <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Ducimus doloremque repellendus, beatae unde alias consequuntur fugit repudiandae tenetur quasi, nam vero neque iure, autem est dolor modi expedita enim temporibus!</p>
        </div>
       </div>
    </div> 
    );
}
 
export default AdmindashBoard;
